class Graph {
    constructor(vertices) {
        this.v = vertices;
        this.graph = new Map();
        this.nodes2 = [];
        this.adjacencyList2 = {};
        this.collection = [];


    }


    addVertex(v) {
        this.graph.set(v, []);
    }

    addEdge2(u, v, weight) {
        this.graph.get(u).push([v, weight]);
        this.graph.get(v).push([u, weight]);
    }

    findAllPaths(start, end = 'K', path = [], weights = [], weight) {

        path = path.concat(start);
